// src/components/Portfolio/Portfolio.jsx
import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './Portfolio.css'


const Portfolio = () => {
    // Use the useNavigate hook to get access to the navigation function
    const navigate = useNavigate();

    // Get the current pathname to determine the active navbar
    const currentPath = window.location.pathname;

    // Determine the active navbar based on the current pathname
    const isCasualNavBar = currentPath.includes('./casual');
    const isProfessionalNavBar = currentPath.includes('/professional');

    return (
        <div>
          {/* Conditionally render the appropriate navbar */}
          {isCasualNavbar && (
            <nav className="navbar-casual">
              <ul>
                <li>
                  <Link to="/">Home</Link>
                </li>
                <li>
                  <Link to="/portfolio">Portfolio</Link>
                </li>
                {/* Add other casual links */}
                <li>
                    <Link to="/AboutMe">About me</Link>
                </li>
              </ul>
            </nav>
          )}
    
          {isProfessionalNavbar && (
            <nav className="navbar-professional">
              <ul>
                <li>
                  <Link to="/">Home</Link>
                </li>
                <li>
                  <Link to="/portfolio">Portfolio</Link>
                </li>
                {/* Add other professional links */}
                <li>
                    <Link to="/Services">Services</Link>
                </li>
              </ul>
            </nav>
          )}
    
          {/* Your portfolio content goes here */}
          <h1>Test Portfolio</h1>
        </div>
      );
    };

export default Portfolio;
